function AddTodo() {
    return (
        <div className='bg-gray-400 absolute rounded-lg p-7 z-50 left-[50%] top-[30%] w-[300px]'>
            <div className='flex flex-col gap-2'>
                <h1>ADD TASK</h1>
                <input className='rounded-md indent-2 outline-none py-1 shadow-2xl' />
                <button className='bg-blue-500 rounded-3xl py-1 w-[10%]'>CREATE TASK</button>
            </div>
        </div>

    )
}

export default AddTodo
